class App extends Component {
  state = {
    todos: []
  }
  componentDidMount() {
    fetch('/api/employees', {
      method: "GET", 
      mode: "cors",
      cache: "no-cache", 
      credentials: "same-origin", 
      headers: {
        "Content-Type": "application/json",
      },
      redirect: "follow", 
      referrerPolicy: "no-referrer", 
    })
    .then(res => res.json())
    .then((data) => {
      this.setState({ todos: data })
      console.log(this.state.todos)
    })
    .catch(console.log)
  }
  render() {

    return (
      <div></div>
    );
  }
}

export default App
